        }
        item.data.push(graph)
        item.axis = [
            { label: xLabel },
            { label: yLabel }
        ];
        const group = groups.filter((item) => item.groupName.includes(table[i].y[j].label));
        const wellsGroup = table[i].y[j].data.map((value, index) => value = {
            title: title,
            well: group[0].groupWells[index],
            array: {
                x: x,
                y: value,
                styles: {
                    selected: {
                        lineColor: `rgb(${colors[j]})`,
                        lineStyle: 1,
                        lineWidth: 2,
                    },
                    unselected: {
                        lineColor: `rgb(${colors[j]})`,
                        lineStyle: 1,
                        lineWidth: 2,
                    },
                }
            },
            analysis: table[i].y[j].label,
            _highlight: j+1,
        })
        plate.push(...wellsGroup)
    }

    let experiment = [];
    for (let k = 0; k < labelsList.length; k++) {
        let element = plate.filter((item) => item.well === labelsList[k])[0];
        element = element === undefined?
            { well: labelsList[k], array: [], analysis: 'background', _highlight: 0 }: element;
        experiment.push(element)
    }

    result.push({
        title: title,
        chart: item,
        annotations: annotations,
        experiment: experiment
    })
}

