function stdAnnotation(x, lowerValues, upperValues, color, options = {}) {
  const {
    transparency = 0.5,
    width = 0.5,
    index = 0,
  } = options;
  let result = [];
  for (let i = 0; i < x.length; i++) {
    const item = {
      position: [
        {x: x[i] - width, y: lowerValues[i], dy: 0},
        {x: x[i] + width, y: upperValues[i], dy: 0}
      ],
      type: 'rect',
      fillColor: `rgba(${color},${transparency})`,//`rgba(${color},${String(transparency)})`,
      strokeColor: `rgba(${color},${transparency})`,//`rgba(${color},${String(transparency)})`,
      strokeWidth: "1px",
    };
    result.push(item)
  }
  return result;
}

function getBoundaries(x, lower, upper) {
    lower = new Array(x.length).fill(lower);
    upper = new Array(x.length).fill(upper);
    const selected = {
        lineColor: `rgba(0,0,0,0)`,
    }
    const result = {
        data:[{
            x: x,
            y: lower,
            styles: {
                selected: selected,
                unselected: selected,
            }
        },
        {
            x: x,
            y: upper,
            styles: {
                selected: selected,
                unselected: selected,
            }
        }]
    }
    return result
}

